import React from 'react';

function Search() {
    return (
        <div style={{ textAlign: 'center', padding: '20px' }}>
            <h1>Search for Books</h1>
            <p>Type a book name or genre to explore our recommendations!</p>
        </div>
    );
}

export default Search;
